import './App.css';
import Navbar from './Navbar/Navbar.jsx';
import Footer from './Footer/Footer.js';
import NotFound from './Page-not-found/PageNoutFound.jsx';
import Main from './Main/Main.jsx';
import Login from './Login/Login.jsx';
import Register from './Sing-up/SignUp.jsx';
import Password from './Forget-password/Password.jsx';

import './Navbar/Navbar.css';
import './Footer/Footer.css';
import './Page-not-found/PageNoutFound.css';
import './Login/Login.css';
import './Sign-in/SignIn.css';
import './Sing-up/SignUp.css';
import './Forget-password/Password.css';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// A layout component that wraps around routes that have the same structure (Navbar and Footer)
function Layout({ children }) {
  return (
    <>
      <Navbar />
      {children}
      <Footer />
    </>
  );
}

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<Layout><Main /></Layout>} />
          <Route path="/projects" element={<Layout><Login /></Layout>} />
          <Route path="/Login" element={<Login />} />
          <Route path="/Register" element={<Register />} />
          <Route path="/Password" element={<Password />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
